class Paginate {
    constructor(length, pages) {
        const [currentPage, setCurrentPage] = pages;
        this.lastPage = 0;
        this.currentPage = currentPage;
        this.setCurrentPage = setCurrentPage;
        this.allPages = length;
    }
}

export default Paginate;
